                    <div class="i_work-process-body-group-block">
                        <!--WORK PROCESS BODY GROUP BLOCK SPAN WEIGHT-->
                        <span class="i_work-process-body-group-block-color">Анализ, Отчет Обследования</span>
                        <!--!WORK PROCESS BODY GROUP BLOCK SPAN WEIGHT-->
                        <!--WORK PROCESS BODY GROUP BLOCK SPAN -->
                        <span>
                            Анализ существующих процессов, разработка рекомендаций по оптимизации и подготовка к информационной системе
                        </span>
                        <!--!WORK PROCESS BODY GROUP BLOCK SPAN -->
                    </div>
                    <!--!WORK PROCESS BODY GROUP BLOCK-->
                    <!--WORK PROCESS BODY GROUP BLOCK-->
                    <div class="i_work-process-body-group-block">
                        <!--WORK PROCESS BODY GROUP BLOCK SPAN WEIGHT-->
                        <span class="i_work-process-body-group-block-color">Настройка прототипа системы, Техническое задание</span>
                        <!--!WORK PROCESS BODY GROUP BLOCK SPAN WEIGHT-->
                        <!--WORK PROCESS BODY GROUP BLOCK SPAN -->
                        <span>
                            Настройка прототипа системы без программирования с реальными данными и моделированием работы пользователей, согласование и корректировка требований
                        </span>
                        <!--!WORK PROCESS BODY GROUP BLOCK SPAN -->
                    </div>
                    <!--!WORK PROCESS BODY GROUP BLOCK-->
                    <!--WORK PROCESS BODY GROUP BLOCK-->
                    <div class="i_work-process-body-group-block">
                        <!--WORK PROCESS BODY GROUP BLOCK SPAN WEIGHT-->
                        <span class="i_work-process-body-group-block-color">Запуск в эксплуатацию</span>
                        <!--!WORK PROCESS BODY GROUP BLOCK SPAN WEIGHT-->
                        <!--WORK PROCESS BODY GROUP BLOCK SPAN -->
                        <span>
                            Запуск системы в эксплуатацию, при этом функциональность системы может расширяться постепенно, охватывая все новые , бизнес-области
                        </span>
                        <!--!WORK PROCESS BODY GROUP BLOCK SPAN -->
                    </div>
                    <!--!WORK PROCESS BODY GROUP BLOCK-->
